import React, { Component } from 'react'
import { Paralax, ParalaxLayer } from 'react-spring/renderprops-addons'

class App extends Component {
  render() {
    return (
      <Paralax pages={1} scrolling={false} horizontal ref={ref => (this.parallax = ref)}>
        <ParalaxLayer offset={1} speed={1} />
      </Paralax>
    )
  }
}

export default App
